# Data load
path = '/content/DengAI_dataset/DengAI dataset/'
train_features = pd.read_csv(path+'dengue_features_train.csv')
train_labels = pd.read_csv(path+'dengue_labels_train.csv')
test_features = pd.read_csv(path+'dengue_features_test.csv')

"""### Merge features and labels

- I merged labels to ensure that the features and corresponding labels are correctly aligned for training. It combines the data into a single DataFrame for model input.
"""

train = train_features.merge(train_labels, on=['city', 'year', 'weekofyear'])

"""## Preprocessing

### Encode city

- This line encodes the city column by mapping the string values ('sj' and 'iq') to numeric values (0 and 1) for easier model processing. The same encoding is applied to both the train and test DataFrames.
"""

# Encode city (sj -> 0, iq -> 1)
train['city'] = train['city'].map({'sj': 0, 'iq': 1})
test = test_features.copy()
test['city'] = test['city'].map({'sj': 0, 'iq': 1})

"""### Extract month from week_start_date

- It adds the extracted month information as a new column in both the train and test DataFrames
"""

train['month'] = pd.to_datetime(train['week_start_date']).dt.month
test['month'] = pd.to_datetime(test['week_start_date']).dt.month

"""### cyclical features for month and weekofyear

- Cyclical features by converting the month and weekofyear into sine and cosine transformations. These new columns (month_sin, month_cos, weekofyear_sin, weekofyear_cos) are added to both the train and test DataFrames to capture periodic patterns
"""

# Create cyclical features for month and weekofyear
for df in [train, test]:
    df['month_sin'] = np.sin(2 * np.pi * df['month'] / 12)
    df['month_cos'] = np.cos(2 * np.pi * df['month'] / 12)
    df['weekofyear_sin'] = np.sin(2 * np.pi * df['weekofyear'] / 52)
    df['weekofyear_cos'] = np.cos(2 * np.pi * df['weekofyear'] / 52)

"""### Drop unnecessary columns"""

# Drop unnecessary columns
columns_to_drop = ['week_start_date', 'year', 'month', 'weekofyear']
train = train.drop(columns=columns_to_drop)
test = test.drop(columns=columns_to_drop)

"""### Fill missing values with median

- Values filled to not have extreme values.
"""

# Fill missing values
for col in train.columns:
    if train[col].isnull().any():
        # Fill with median grouped by city
        train[col] = train.groupby('city')[col].transform(lambda x: x.fillna(x.median()))

for col in test.columns:
    if test[col].isnull().any():
        test[col] = test.groupby('city')[col].transform(lambda x: x.fillna(x.median()))

"""### Split train (x) and (y)"""

# Split into features and target
X = train.drop(columns=['total_cases'])
y = train['total_cases']

"""### Validation set"""

